import React from "react";
import Box3x3 from "../Box3x3/Box3x3";

const Box9x9 = ({getId}) => {
    return (
        <div>
        <div className="Box9x3">
      <Box3x3 click={getId} boxid={1}/>
      <Box3x3 click={getId} boxid={2}/>
      <Box3x3 click={getId} boxid={3}/>
      </div>
      <div className="Box9x3">
      <Box3x3 click={getId} boxid={4}/>
      <Box3x3 click={getId} boxid={5}/>
      <Box3x3 click={getId} boxid={6}/>
      </div>
      <div className="Box9x3">
      <Box3x3 click={getId} boxid={7}/>
      <Box3x3 click={getId} boxid={8}/>
      <Box3x3 click={getId} boxid={9}/>
      </div>
        </div>
    );
};

export default Box9x9;
